import React from 'react'

function TeamDiv(props) {
    return (
        <div className = 'team-div'>
            <img src = {props.photo}/>
            <div className = 'team-line-wrap'>
            <div className = 'team-line'></div>
            </div>
            <h2>{props.name}</h2>
            <div className = 'team-sm'>
                {/* {props.sm.map(item => {
                    return(
                        <img src = {item.img}   />
                    )
                })}  */}
            </div>

        </div>
    )
}

export default TeamDiv
